ustify"}},mdx("strong",null,"The end result can be found ",mdx("a",{href:"https://github.com/PlantsAndBuildings/cpp-cnn"},"on my Github")),". I do plan to add a useful README and instructions for building and running the network soon. In this post, I plan to focus on the aspects I found interesting and challenging about the process - the code on Github contains all the remaining missing parts."),mdx("h3",{style:{"textAlign":"justify"}},"1. Which ones do I use?"),mdx("p",{style:{"textAlign":"justify"}},"Right off the bat, I made some decisions about the tools I would use for the implementation:"),mdx("p",{style:{"textAlign":"justify"}},"1. I'd already decided that the ",mdx("strong",null,"implementation would be in C++")),mdx("p",{style:{"textAlign":"justify"}},"2. I knew that I needed linear algebra utilities - and I knew of two libraries which could provide that for me: ",mdx("strong",null,mdx("a",{href:"http://arma.sourceforge.net/"},"Armadillo"))," and ",mdx("strong",null,mdx("a",{href:"http://eigen.tuxfamily.org"},"Eigen")),". I'd had some experience with both, more with Eigen than Armadillo, but I would have had to install Eigen on my system - and I couldn't be bothered to do that. ",mdx("strong",null,"Hence, Armadillo.")),mdx("p",{style:{"textAlign":"justify"}},"3. I decided (and I still pat myself on the back for this decision) to properly test the code as I was writing it. I decided to use the ",mdx("strong",null,mdx("a",{href:"https://www.boost.org/doc/libs/1_53_0/libs/test/doc/html/utf.html"},"Boost Test Framework"))," to write unit tests."),mdx("p",{style:{"textAlign":"justify"}},"A few days into the project I also decided to use the ",mdx("strong",null,mdx("a",{href:"https://cmake.org/"},"CMake"))," build system to easily build and run my code."),mdx("h3",{style:{"textAlign":"justify"}},"2. Forward and Backward"),mdx("p",{style:{"textAlign":"justify"}},"I started right in the middle of everything - the convolution layer was the first thing I wanted to do. After a quick constructor implementation, I came to the Forward and Backward passes. The Forward pass was pretty straight-"forward"... See what I did there? ",mdx("strong",null,"There are several excellent explanations ",mdx("a",{href:"https://www.youtube.com/watch?v=bNb2fEVKeEo&t=0s&list=PL3FW7Lu3i5JvHM8ljYj-zLfQRF3EO8sYv&index=5"},"(one can be found here)")," of the forward pass, and TBH it's not that tough to understand, so I won't go into it here.")," I'll just paste my code:"),mdx("pre",null,mdx("code",_extends({parentName:"pre"},{"className":"language-c++"}),"void Forward(arma::cube& input, arma::cube& output)
{
  // The filter dimensions and strides must satisfy some contraints for
  // the convolution operation to be well defined.
  assert((inputHeight - filterHeight)%verticalStride == 0);
  assert((inputWidth - filterWidth)%horizontalStride == 0);

  // Output initialization.
  output = arma::zeros((inputHeight - filterHeight)/verticalStride + 1,
                       (inputWidth - filterWidth)/horizontalStride + 1,
                       numFilters);

  // Perform convolution for each filter.
  for (size_t fidx = 0; fidx < numFilters; fidx++)
  {
    for (size_t i=0; i <= inputHeight - filterHeight; i += verticalStride)
      for (size_t j=0; j <= inputWidth - filterWidth; j += horizontalStride)
        output((i/verticalStride), (j/horizontalStride), fidx) = arma::dot(
            arma::vectorise(
                input.subcube(i, j, 0,
                              i+filterHeight-1, j+filterWidth-1, inputDepth-1)
              ),
            arma::vectorise(filters[fidx]));
  }

  // Store the input and output. This will be needed by the backward pass.
  this->input = input;
  this->output = output;
}
")),mdx("p",{style:{"textAlign":"justify"}},"The backward pass needed some effort. The reason for that requires a slight digression:"),mdx("p",{style:{"textAlign":"justify"}},"See, the issue with most texts on back-propagation (and ultimately most resources on neural networks that I've come across - ",mdx("strong",null,"with the notable exception of Andrej Karpathy's ",mdx("a",{href:"http://cs231n.stanford.edu/"},"CS231n")),") is that they explain things like gradients flowing backwards only in the context of dense layers. When I first started reading about backprop, I had this notion that it was a specialized mathematical technique developed by neural network scientists (?) to be applied only in the context of training neural networks - and that too fully connected feedforward networks. It is not that tough to grasp backpropagation in this context because all operations are dot products and sigmoid/softmax activations - and we all can calculate derivatives of these functions using high-school calculus. Then you find out about convnets and now you have this scary new operation called a convolution which involves a filter and sliding across an input - and it is certainly not intuitive how a gradient can be calculated. By the time one gets to reading about RNNs and LSTMs, they've given up all hope on trying to understand how the backward pass works. This ignorance is enabled, nay, encouraged by prebuilt, packaged, served-on-a-silver-platter layers the kind of which are provided by Keras, Caffe and jack-in-the-box deep learning framework."),mdx("p",{style:{"textAlign":"justify"}},"The real trick to figuring out the backward pass through a convolution layer is that there is no trick. You just have to roll up your sleeves, clench your jaw, muster up all your grit and write it out on a piece of paper - atleast that's how I did it (perhaps to a less dramatic narration). ",mdx("strong",null,"Deriving backpropagation equations for any layer on your own, without looking up an